import React, { useState, useEffect } from 'react';
import { useAuth } from '../../context/AuthContext';
import api from '../../services/api';

const BranchesManagement = () => {
  const { user, isAuthenticated } = useAuth();
  const [branches, setBranches] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    // üî• ÿ™ÿ£ÿÆŸäÿ± ÿßŸÑÿ™ŸÜŸÅŸäÿ∞ ŸÇŸÑŸäŸÑÿßŸã ŸÑÿ∂ŸÖÿßŸÜ ÿ™ÿ≠ŸÖŸäŸÑ AuthContext
    const timer = setTimeout(() => {
      checkAuthAndLoad();
    }, 100);

    return () => clearTimeout(timer);
  }, []);

  const checkAuthAndLoad = async () => {
    try {
      // üî• ÿßŸÑÿ™ÿ≠ŸÇŸÇ ÿßŸÑÿ®ÿ≥Ÿäÿ∑ ŸÖŸÜ ÿßŸÑŸÖÿµÿßÿØŸÇÿ©
      const token = localStorage.getItem('token');
      if (!token) {
        throw new Error('No auth data - Ÿäÿ±ÿ¨Ÿâ ÿ™ÿ≥ÿ¨ŸäŸÑ ÿßŸÑÿØÿÆŸàŸÑ ÿ£ŸàŸÑÿßŸã');
      }
      
      if (!isAuthenticated || !user) {
        throw new Error('ÿßŸÑŸÖÿ≥ÿ™ÿÆÿØŸÖ ÿ∫Ÿäÿ± ŸÖÿ≥ÿ¨ŸÑ - Ÿäÿ±ÿ¨Ÿâ ÿ™ÿ≥ÿ¨ŸäŸÑ ÿßŸÑÿØÿÆŸàŸÑ');
      }
      
      // üî• ÿ¨ŸÑÿ® ÿßŸÑŸÅÿ±Ÿàÿπ
      await loadBranches();
    } catch (error) {
      console.error('‚ùå ÿÆÿ∑ÿ£ ŸÅŸä ÿßŸÑÿ™ÿ≠ŸÇŸÇ ŸÖŸÜ ÿßŸÑŸÖÿµÿßÿØŸÇÿ©:', error);
      setError(error.message);
    } finally {
      setLoading(false);
    }
  };

  const loadBranches = async () => {
    try {
      const response = await api.get('/branches');
      if (response.success) {
        setBranches(response.data);
      } else {
        setError(response.message || 'ŸÅÿ¥ŸÑ ÿ¨ŸÑÿ® ÿßŸÑŸÅÿ±Ÿàÿπ');
      }
    } catch (error) {
      setError('ÿ≠ÿØÿ´ ÿÆÿ∑ÿ£ ŸÅŸä ÿßŸÑÿßÿ™ÿµÿßŸÑ ÿ®ÿßŸÑÿ≥Ÿäÿ±ŸÅÿ±');
    }
  };

  if (loading) {
    return (
      <div className="flex justify-center items-center h-64">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-500"></div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="bg-red-50 border border-red-200 rounded-lg p-6">
        <h3 className="text-red-800 font-bold mb-2">‚ö†Ô∏è ÿÆÿ∑ÿ£</h3>
        <p className="text-red-600">{error}</p>
        <button 
          onClick={() => window.location.href = '/login'}
          className="mt-4 bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700"
        >
          ÿ™ÿ≥ÿ¨ŸäŸÑ ÿßŸÑÿØÿÆŸàŸÑ
        </button>
      </div>
    );
  }

  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold mb-6">ÿ•ÿØÿßÿ±ÿ© ÿßŸÑŸÅÿ±Ÿàÿπ</h1>
      
      <div className="bg-white rounded-lg shadow overflow-hidden">
        <div className="p-4 bg-gray-50 border-b">
          <div className="flex justify-between items-center">
            <h2 className="text-lg font-semibold">ŸÇÿßÿ¶ŸÖÿ© ÿßŸÑŸÅÿ±Ÿàÿπ</h2>
            <button className="bg-green-600 text-white px-4 py-2 rounded hover:bg-green-700">
              + ÿ•ÿ∂ÿßŸÅÿ© ŸÅÿ±ÿπ
            </button>
          </div>
        </div>
        
        <div className="overflow-x-auto">
          <table className="min-w-full divide-y divide-gray-200">
            <thead className="bg-gray-50">
              <tr>
                <th className="px-6 py-3 text-right text-xs font-medium text-gray-500 uppercase tracking-wider">
                  #
                </th>
                <th className="px-6 py-3 text-right text-xs font-medium text-gray-500 uppercase tracking-wider">
                  ÿßÿ≥ŸÖ ÿßŸÑŸÅÿ±ÿπ
                </th>
                <th className="px-6 py-3 text-right text-xs font-medium text-gray-500 uppercase tracking-wider">
                  ÿßŸÑŸÖŸàŸÇÿπ
                </th>
                <th className="px-6 py-3 text-right text-xs font-medium text-gray-500 uppercase tracking-wider">
                  ÿßŸÑÿ≠ÿßŸÑÿ©
                </th>
                <th className="px-6 py-3 text-right text-xs font-medium text-gray-500 uppercase tracking-wider">
                  ÿßŸÑÿ•ÿ¨ÿ±ÿßÿ°ÿßÿ™
                </th>
              </tr>
            </thead>
            <tbody className="bg-white divide-y divide-gray-200">
              {branches.length > 0 ? (
                branches.map((branch, index) => (
                  <tr key={branch.id}>
                    <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                      {index + 1}
                    </td>
                    <td className="px-6 py-4 whitespace-nowrap">
                      <div className="text-sm font-medium text-gray-900">
                        {branch.name}
                      </div>
                      <div className="text-sm text-gray-500">
                        {branch.branch_code}
                      </div>
                    </td>
                    <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                      {branch.location}
                    </td>
                    <td className="px-6 py-4 whitespace-nowrap">
                      <span className={`px-2 inline-flex text-xs leading-5 font-semibold rounded-full ${
                        branch.is_active ? 'bg-green-100 text-green-800' : 'bg-red-100 text-red-800'
                      }`}>
                        {branch.is_active ? 'ŸÜÿ¥ÿ∑' : 'ÿ∫Ÿäÿ± ŸÜÿ¥ÿ∑'}
                      </span>
                    </td>
                    <td className="px-6 py-4 whitespace-nowrap text-sm font-medium">
                      <button className="text-blue-600 hover:text-blue-900 mr-3">
                        ÿ™ÿπÿØŸäŸÑ
                      </button>
                      <button className="text-red-600 hover:text-red-900">
                        ÿ≠ÿ∞ŸÅ
                      </button>
                    </td>
                  </tr>
                ))
              ) : (
                <tr>
                  <td colSpan="5" className="px-6 py-4 text-center text-gray-500">
                    ŸÑÿß ÿ™Ÿàÿ¨ÿØ ŸÅÿ±Ÿàÿπ
                  </td>
                </tr>
              )}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default BranchesManagement;
